        systemData = mergeData(systemData, BACKUP_DATA);
        showNotification('‚ö†Ô∏è –ò—Å–ø–æ–ª—å–∑—É–µ–º –ª–æ–∫–∞–ª—å–Ω—ã–π –±—ç–∫–∞–ø', 'warning');
