        systemData.stateSecret[type] = systemData.stateSecret[type].filter(item => item.id !== id);
        if (saveAllData()) showNotification('‚úÖ –ó–∞–ø–∏—Å—å —É–¥–∞–ª–µ–Ω–∞ –∏–∑ –≥–æ—Å—É–¥–∞—Ä—Å—Ç–≤–µ–Ω–Ω–æ–π —Ç–∞–π–Ω—ã', 'success');
